  "description": "Gustaf Victor Hugo Brinkenberg was a Swedish assistant minister, born in Vassända-Naglum on June 10th, 1897. He was married to Sigrid Andersson in 1921, and they had five children. Brinkenberg passed his high school exam in Vänersborg in 1918, his Bachelor of Divinity in 1927, and his practical theology exam in 1931. He was ordained in the diocese of Skara in 1932. Brinkenberg worked as an assistant minister and interim assistant minister in Rångedala, as a minister in Berg, and as a military pastor. He also served as a staff member of the Water Authority and as a private teacher. Brinkenberg was the vice-chairman of the school board, a member of the municipal council, and a member of the child welfare committee. He wrote poetry, mystery plays, and treatises on church doctrine. He enjoyed studying history and ecology."
